                    <h4>Page Not Found</h4>
                    <p>Let's pretend ..... !! You never saw that. Go back to the Homepage to find out more.</p>
                    <div className="bTn"><Link to="/" className="site_btn">Back to the website</Link></div>
                </div>
            </div>
        </section>
    );
}
